import React, { Component, useState } from 'react';
import Navbar from './components/layout/Navbar';
import Search from './components/quotes/Search';
import Quotes from './components/quotes/Quotes';
import axios from 'axios';
import './App.css';

const App = () => {
  state = {
    quotes: {},
    count: null
  };
  //const [countries, setCountries] = useState({});
  const [countries, setCountries] = useState({});
  const [count, setCount] = useState(null);

  const searchCountries = async text => {
    const res = await axios.get(
      `https://cors-anywhere.herokuapp.com/https://api.tronalddump.io/search/quote?query=${text}`
    );

    //this.setState({ quotes: res.data._embedded.quotes, count: res.data.count });
    setCountries(res.data._embedded.quotes);
    setCount(res.data.count);
    console.log(res.data);
  };

  return (
    <div className='App'>
      <Navbar />
      <Search search={searchCountries} />
    </div>
  );
};

